import React from 'react'
import TextField from '@material-ui/core/TextField'
import { useDispatch, useSelector } from 'react-redux'
import Button from '@material-ui/core/Button'
import ButtonGroup from '@material-ui/core/ButtonGroup'
import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        '& > *': {
            margin: theme.spacing(1),
            width: '100%'
        }
    }
}))

function Positions () {
    const classes = useStyles()
    const dispatch = useDispatch()
    const state = useSelector(state => state.Contacts)
    console.log(state)

    const onChangeInput = (e) => {
        dispatch({
            type: 'ON_CHANGE_CONTACTS',
            datas: { [e.target.name]: e.target.value }
        })
    }
    return (
        <>
            <h1>Parler à un conseiller: 09 72 65 24 84</h1>
            <div className={classes.root}>
                <ButtonGroup
                    variant="contained"
                    color="primary"
                    aria-label="contained primary button group"
                >
                    <Button
                        fullWidth={true}
                        style={{ flex: 1 }}
                    >Particulier</Button>
                    <Button
                        fullWidth={true}
                        style={{ flex: 1 }}
                    >Professionnel</Button>
                </ButtonGroup>
            </div>
            <div
                style={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    width: '100%'
                }}>
                <TextField
                    label="Prénom*"
                    value={state.Prenom}
                    onChange={onChangeInput}
                    variant="outlined"
                    margin="dense"
                    name="Prenom"
                />
                <div style={{ width: 10 }}></div>
                <TextField
                    label="Nom*"
                    value={state.Nom}
                    onChange={onChangeInput}
                    margin="dense"
                    variant="outlined"
                    name="Nom"
                />
            </div>
            <div
                style={{
                    display: 'flex',
                    justifyContent: 'space-between',
                    width: '100%'
                }}>
                <TextField
                    label="Email*"
                    value={state.Email}
                    onChange={onChangeInput}
                    margin="dense"
                    variant="outlined"
                    name="Email"
                />
                <div style={{ width: 10 }}></div>
                <TextField
                    label="Téléphone*"
                    value={state.Tel}
                    onChange={onChangeInput}
                    margin="dense"
                    variant="outlined"
                    name="Tel"
                />
            </div>
        </>
    )
}

export default Positions
